import React, { useState, useEffect } from 'react';
import { adminAPI } from '../../utils/api';
import AdminUpload from '../AdminUpload/AdminUpload';
import SessionUpload from '../SessionUpload/SessionUpload';
import AdminReports from '../AdminReports/AdminReports';
import './AdminDashboard.css';

const AdminDashboard = ({ user, onLogout }) => {
  const [activeTab, setActiveTab] = useState('sessions');
  const [sessions, setSessions] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [resumes, setResumes] = useState([]);
  const [menuOpen, setMenuOpen] = useState(false);
  const [newJob, setNewJob] = useState({
    title: '',
    company: '',
    location: '',
    experience: '',
    skills: '',
    description: ''
  });
  const [newSession, setNewSession] = useState({
    sessionId: '',
    title: '',
    speaker: '',
    time: '',
    room: '',
    track: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    if (activeTab === 'sessions') {
      loadSessions();
    }
  }, [activeTab]);

  const loadSessions = async () => {
    try {
      const response = await adminAPI.getSessions();
      setSessions(response.data);
    } catch (error) {
      setError('Failed to load sessions');
    }
  };

  const handleInputChange = (e) => {
    setNewSession({
      ...newSession,
      [e.target.name]: e.target.value
    });
  };

  const handleCreateSession = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setMessage('');

    try {
      await adminAPI.createSession(newSession);
      setMessage('Session created successfully');
      setNewSession({
        sessionId: '',
        title: '',
        speaker: '',
        time: '',
        room: '',
        track: ''
      });
      loadSessions();
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to create session');
    } finally {
      setLoading(false);
    }
  };

  const renderTabContent = () => {
    switch (activeTab) {
      case 'sessions':
        return (
          <div className="sessions-tab">
            <div className="create-session-form">
              <h3>Create New Session</h3>
              <form onSubmit={handleCreateSession}>
                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Session ID</label>
                    <input
                      type="text"
                      name="sessionId"
                      value={newSession.sessionId}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Title</label>
                    <input
                      type="text"
                      name="title"
                      value={newSession.title}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Speaker</label>
                    <input
                      type="text"
                      name="speaker"
                      value={newSession.speaker}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Time</label>
                    <input
                      type="text"
                      name="time"
                      value={newSession.time}
                      onChange={handleInputChange}
                      className="form-input"
                      placeholder="e.g., 10:00 AM - 11:00 AM"
                      required
                    />
                  </div>
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label className="form-label">Room</label>
                    <input
                      type="text"
                      name="room"
                      value={newSession.room}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                  <div className="form-group">
                    <label className="form-label">Track</label>
                    <input
                      type="text"
                      name="track"
                      value={newSession.track}
                      onChange={handleInputChange}
                      className="form-input"
                      required
                    />
                  </div>
                </div>

                <button type="submit" className="btn btn-primary" disabled={loading}>
                  {loading ? 'Creating...' : 'Create Session'}
                </button>
              </form>

              {message && <div className="success-message">{message}</div>}
              {error && <div className="error-message">{error}</div>}
            </div>

            <div className="sessions-list">
              <h3>Existing Sessions ({sessions.length})</h3>
              {sessions.length === 0 ? (
                <p>No sessions created yet</p>
              ) : (
                <div className="sessions-grid">
                  {sessions.map((session) => (
                    <div key={session.sessionId} className="session-item">
                      <h4>{session.title}</h4>
                      <p><strong>Speaker:</strong> {session.speaker}</p>
                      <p><strong>Time:</strong> {session.time}</p>
                      <p><strong>Room:</strong> {session.room}</p>
                      <p><strong>Track:</strong> {session.track}</p>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        );

      case 'upload':
        return (
          <div>
            <AdminUpload />
            <SessionUpload onUploadSuccess={loadSessions} />
          </div>
        );

      case 'reports':
        return <AdminReports />;

      default:
        return null;
    }
  };

  return (
    <div className="admin-dashboard">
      <header className="header">
        <div className="container">
          <div className="header-content">
            <div className="header-brand">
              <h1>AWS UG Vadodara - Admin Panel</h1>
              <p className="subtitle">Community Day Management</p>
            </div>
            <div className="header-right">
              <div className={`header-actions ${menuOpen ? 'open' : ''}`}>
                <button className="btn btn-secondary" onClick={onLogout}>
